import React from "react";
import { StyleSheet, Text, View, StatusBar, Dimensions } from 'react-native';
import { Icon } from 'react-native-elements';

const Ikon = () => {

    return (
        <View>
            <Text>Icon yeri</Text>

        </View>
    );
};


export default Ikon;
